import React from 'react'
import styled from 'styled-components';
import { TEXTLOGO_URL } from '../../config';

const Header: React.FC = () => {
    return (
        <Logo />
    )
}

export default Header;

const Logo = styled.div`
    min-width: 200px;
    max-width: 400px;
    min-height: 100px;
    max-height: 180px;
    background-image: url(${TEXTLOGO_URL});
`;
